import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import OrderManagement from './pages/OrderManagement';
import KitchenDispatch from './pages/KitchenDispatch';
import './App.css';

function App() {
  return (
    <Router>
      <div className="App">
        <nav className="navbar">
          <div className="navbar-container">
            <h1 className="app-title">Restaurant HEMS</h1>
            <ul className="nav-menu">
              <li>
                <Link to="/" className="nav-link">Order Management</Link>
              </li>
              <li>
                <Link to="/kitchen" className="nav-link">Kitchen Dispatch</Link>
              </li>
            </ul>
          </div>
        </nav>

        <main className="main-content">
          <Routes>
            <Route path="/" element={<OrderManagement />} />
            <Route path="/kitchen" element={<KitchenDispatch />} />
          </Routes>
        </main>
      </div>
    </Router>
  );
}

export default App;
